■地震の揺れが来る前に音声と画面でお知らせ！<br>■ＴＶ、ラジオ、携帯電話とは異なる「高度利用配信」と「現地演算方式」を採用。<br>■より早く、正確な情報をお届けします。<br>■5年間情報配信料無料！※5年で情報配信は停止いたします。<br>■2種類のシミュレーション訓練機能で幅広い訓練が可能！<br>■過去の55件の地震データを搭載。<br>■津波・噴火情報に対応。気象庁の発表を音声と画面でお知らせ！<br><br>気象庁地震動予報業務許可番号 ― 許可 第164号<br><br><style type="text/css">
